(1, 1, '2016-02-02 14:47:58', '2016-02-02 06:47:58', '歡迎來到 WordPress。這是你的第一篇文章。編輯或者刪除本篇文章，然後開始你的部落客生活！', 'Hello world! 哈囉！', '', 'trash', 'open', 'open', '', 'hello-world-%trashed%', '', '', '2016-03-01 11:20:54', '2016-03-01 03:20:54', '', 0, 'http://localhost:8080/?p=1', 0, 'post', '', 0),
(2, 1, '2016-02-02 14:47:58', '2016-02-02 06:47:58', '這是一個範例頁面。它和網誌文章不同，因為它的頁面位置是固定的，同時會顯示於你的網誌導覽選單（大多數的佈景主題）。大多數的人會新增一個「關於」頁面向訪客介紹自己。它可能類似下面這樣：\n\n<blockquote>嗨！你好！白天我是一位單車快遞員，晚上則是個有抱負的演員，這是我的網誌。我居住在台灣高雄，養了一隻名為 Jack 的狗。</blockquote>\n\n...或像這樣：\n\n<blockquote>XYZ Doohickey Comany 成立於 1971 年，公司成立以來，我們一直向市民提供高品質的 doohickies 。我們位於台北市，有超過 2,000 名員工，對台北市政府有著相當大的貢獻。</blockquote>\n\n作為一個新的 WordPress 使用者，你可以前往<a href="http://localhost:8080/wp-admin/">你的控制台</a>刪除這個頁面，並建立一個屬於你的全新內容。祝使用愉快！', '範例頁面', '', 'publish', 'closed', 'open', '', 'sample-page', '', '', '2016-02-02 14:47:58', '2016-02-02 06:47:58', '', 0, 'http://localhost:8080/?page_id=2', 0, 'page', '', 0),
