(20, 1, '2016-02-23 11:40:26', '2016-02-23 03:40:26', '台灣冷門景點復甦計劃發起者「如果覺得這世界不夠好，你應該去打\r\n造一個好的世界。」歐北來，由一群有想法有行動的青年組成。為了\r\n使台灣更好，他們用最單純最在地的方式去認識這塊土地；他們出走\r\n，感受，然後傳遞，為更好的台灣。他們是歐北來，超越想像的歐北\r\n來。', '如果覺得這世界不夠好，你應該去打造一個 好的世界', '', 'publish', 'closed', 'closed', '', '%e5%a6%82%e6%9e%9c%e8%a6%ba%e5%be%97%e9%80%99%e4%b8%96%e7%95%8c%e4%b8%8d%e5%a4%a0%e5%a5%bd%ef%bc%8c%e4%bd%a0%e6%87%89%e8%a9%b2%e5%8e%bb%e6%89%93%e9%80%a0%e4%b8%80%e5%80%8b-%e5%a5%bd%e7%9a%84%e4%b8%96', '', '', '2016-02-24 10:31:24', '2016-02-24 02:31:24', '', 0, 'http://localhost:8080/?post_type=videos&#038;p=20', 0, 'videos', '', 0),
