(30, 1, '2016-03-01 11:22:58', '2016-03-01 03:22:58', '步步維艱的時代，\r\n人人總想成為眾所『荊豔』的佼佼者\r\n未知的年代，\r\n你多久不再靜心聆聽內心的自己？\r\n不再走出矗立的高樓？ 不再親身感受大地脈搏？\r\n這次的年會主題為「荊豔」，擁有著三大元素：挖掘公民心視野、感受腳下記憶、凝聚內在力量\r\n國立中正大學TEDxChungChengU團隊\r\n將首次邀請來自三大領域的八位講者一同為您打造令您驚豔的饗宴\r\nIn the tough age, be the amazing one.', '關於荊豔 ABOUT - Dig More Stories About Chiayi', '', 'publish', 'closed', 'closed', '', '%e9%97%9c%e6%96%bc%e8%8d%8a%e8%b1%94-about-dig-more-stories-about-chiayi', '', '', '2016-03-01 11:22:58', '2016-03-01 03:22:58', '', 0, 'http://localhost:8080/?post_type=events&#038;p=30', 0, 'events', '', 0),
